import React from 'react';
import './home.css';
import Title from './Title.js';
import ProfileImage from './ProfileImage.js';

const Home = () => {
  return (
    <div className='home'>
      <div className="Home-header">
        <ProfileImage />
          <div className="title-header">
          <Title />
        </div>
      </div>
    </div>
  );
}

export default Home;
